import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';

import HomePage from "./pages/HomePage"

function App() {
  return (
    <Router>
      <div className="App">
        <Link to="/">Home</Link>
      </div>

      <Switch>
        <Route path="/"><HomePage/></Route>
      </Switch>
    </Router>
  );
}


export default App;
